import React, { useRef } from "react";
import {
  motion,
  useScroll,
} from "framer-motion";
import LiIcon from "./LiIcon";

const Details = ({ position, company, companyLink, time, address, work, logoUrl }) => {
  const ref = useRef(null);

  return (
    <li
      ref={ref}
      className="my-8 first:mt-0 last:mb-0 w-[60%] mx-auto flex flex-col items-start justify-between md:w-[80%]"
    >
      <LiIcon reference={ref} />
      <motion.div
        initial={{ y: 70 }}
        whileInView={{ y: 0 }}
        transition={{ duration: 0.8, type: "spring" }}
      >
        {/* Add the logo image */}
        <img
          src={logoUrl}
          alt={`${company} Logo`}
          className="logo-image h-12 mb-2"
        />

        <h3 className="capitalize font-bold text-2xl sm:text-xl xs:text-lg">
          {position}{" "}
          <a
              style={{ color: "tan" }} // Add inline style here

            className="capitalize text-primary dark:text-primaryDark"
            href={companyLink}
            target={"_blank"}
            rel="noopener noreferrer"
          >
            @{company}
          </a>
        </h3>
        <span className="capitalize text-dark/75 font-medium dark:text-light/50 xs:text-sm">
          {time} | {address}
        </span>
        <p className="font-medium w-full md:text-sm"> {work}</p>
      </motion.div>
    </li>
  );
};



const Experience = () => {

  const ref = useRef(null);

  const { scrollYProgress } = useScroll({
    target: ref,
    offset: ["start center", "center start"],
  });

  return (

      <div className="my-64">
        <h2 className="font-bold text-8xl mb-32 w-full text-center md:text-6xl xs:text-4xl md:mb-12">
          Experience
        </h2>

        <div ref={ref} className="relative w-[95%] mx-auto lg:w-[90%] md:w-full">
          <motion.div
            className="absolute left-9 top-0 w-[4px] md:w-[2px] md:left-[30px] xs:left-[20px] h-full bg-dark 
            origin-top  dark:bg-primaryDark dark:shadow-3xl"
            style={{ scaleY: scrollYProgress }}
          />
          <ul className="w-full flex flex-col items-start justify-between ml-4 xs:ml-2 mt-4 xs:ml-2">
            <Details
              position="Graduate Research Assistant"
              company=" University of Central Florida"
              companyLink="https://www.ucf.edu/"
              time="June 2023 - August 2023"
              address="Lake Mary, FL"
              work="Engineered a 3D interactive flashcard quiz application using Three.js and React.js, designing the UI/UX with Tailwind CSS, implementing Context API with PostgreSQL, enhancing keyboard navigation with TypeScript and Next.js.Utilizing serverless architecture with AWS Lambda, and incorporated React Redux Toolkit and Elasticsearch."
              logoUrl="data:image/png;base64,"/>
            <Details
              position="Software Engineer"
              company="Zensar Technologies"
              companyLink="https://www.zensar.com/"
              time="August 2022 - Present"
              address="Orlando, FL."
              work="As a developer, I created a robust SaaS product using Spring Boot with a Microservices architecture, enhancing system efficiency and modularity. I integrated RESTful APIs and Apache Kafka with Eureka server, and established an API Gateway with Spring Cloud Gateway, improving log analysis efficiency. Additionally, I implemented automated UI tests with Selenium, integrated Spring Test into CI/CD pipelines, and utilized Grafana, Prometheus, Docker, Kubernetes, and Snowflake for comprehensive system monitoring and real-time data processing.





"
              logoUrl="data:image/png;base64," />


            <Details
              position="Frontend Developer"
              company="Coign Technologies"

              companyLink="https://www.coignconsulting.com/"
              time="May 2022 - August 2022"
              address="Remote"
              work="As a Frontend Developer, I pioneered a full stack web application using Vue.js and Django REST, resulting in a 25% increase in user engagement. I devised a potent CI/CD pipeline with Cypress, Jenkins, and Gitlab, whic. Additionally, I orchestrated the software development lifecycle and test-driven development (TDD) through effective Sprint planning."
              logoUrl="data:image/png;base64,"
            />


          </ul>
        </div>
        </div>
    );
};

export default Experience;
